import React from 'react';
import {Menu} from "semantic-ui-react";

export default function Navbar() {
  return (
    <Menu stackable fixes="top">
      <Menu.Item header>Kenyatta's Profile</Menu.Item>
      <Menu.Item as={Navbar} to="/" name="Home"/>
    </Menu>
  )
}
